import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import Message from './components/Message'
import Login from './components/Login'
import Tracking from './components/Tracking'
import Subscribe from './components/Subscribe'
import reportWebVitals from './reportWebVitals';

ReactDOM.createRoot(document.getElementById('root')).render(<App />);
ReactDOM.createRoot(document.getElementById('rootMessage')).render(<Message />);
ReactDOM.createRoot(document.getElementById('rootLogin')).render(<Login />);
ReactDOM.createRoot(document.getElementById('rootSubscribe')).render(<Subscribe />);
ReactDOM.createRoot(document.getElementById('rootTracking')).render(<Tracking />);

reportWebVitals();
